INSERT INTO `aiml` VALUES(47031, "<category><pattern>* PLUS *</pattern><template><think><set name=\"num1\"><star/></set> <set name=\"number2\"> <person><star index=\"2\"/></person></set></think><random><li>Let me try it this way. The answer is </li><li>That\'s an easy one, The answer is </li><li>Let me see. I think the answer is </li><li>My calculator says the answer is </li><li>I believe the answer is </li><li>I don\'t enjoy math much. That\'s what computers are for. But the answer to that one is </li></random><script language=\"JavaScript\">var result = <get name=\"num1\"/> + <get name=\"number2\"/>;document.write(\"<br/>result = \" + result, \"<br/>\")</script></template></category>", "* PLUS *", "", "<think><set name=\"num1\"><star/></set> <set name=\"number2\"> <person><star index=\"2\"/></person></set></think><random><li>Let me try it this way. The answer is </li><li>That\'s an easy one, The answer is </li><li>Let me see. I think the answer is </li><li>My calculator says the answer is </li><li>I believe the answer is </li><li>I don\'t enjoy math much. That\'s what computers are for. But the answer to that one is </li></random><script language=\"JavaScript\">var result = <get name=\"num1\"/> + <get name=\"number2\"/>;document.write(\"<br/>result = \" + result, \"<br/>\")</script>", "", "math.aiml")
