INSERT INTO `aiml` VALUES(385008, "<category>\r\n<pattern>test points</pattern> \r\n<template>\r\n<think>\r\n<set name=\"star\"><star /></set>\r\n</think>\r\n<condition>\r\n<li name=\"star\" value=\"1\">\r\nyou have chosen apple\r\n</li>\r\n<li name=\"star\" value=\"2\">\r\nyou have chosen orange\r\n</li>\r\n<li name=\"star\" value=\"3\">\r\nyou have chosen pear\r\n</li>\r\n<li>1.apple 2.orange 3.pear</li>\r\n</condition>\r\n</template>\r\n</category>", "test points", "", "<think>\r\n<set name=\"star\"><star /></set>\r\n</think>\r\n<condition>\r\n<li name=\"star\" value=\"1\">\r\nyou have chosen apple\r\n</li>\r\n<li name=\"star\" value=\"2\">\r\nyou have chosen orange\r\n</li>\r\n<li name=\"star\" value=\"3\">\r\nyou have chosen pear\r\n</li>\r\n<li>1.apple 2.orange 3.pear</li>\r\n</condition>", "", "")
