INSERT INTO `aiml` VALUES(385012, "<category>\r\n<pattern>OVERTRAINING</pattern>\r\n<template>\r\n	Here are some features of overtraining:\r\n	<br/>\r\n	1. Decreased ability to achieve training goals.\r\n	<br/>\r\n	2. Lack of motivation to practice.\r\n	<br/>\r\n	3. Getting tired easily.\r\n	<br/>\r\n	4. Unwilligness to co-operate with teammates.\r\n	<br/><br/>\r\n	Do you feel that you are experiencing those signs?\r\n</template>\r\n</category>", "OVERTRAINING", "", "Here are some features of overtraining:\r\n	<br/>\r\n	1. Decreased ability to achieve training goals.\r\n	<br/>\r\n	2. Lack of motivation to practice.\r\n	<br/>\r\n	3. Getting tired easily.\r\n	<br/>\r\n	4. Unwilligness to co-operate with teammates.\r\n	<br/><br/>\r\n	Do you feel that you are experiencing those signs?", "", "")
INSERT INTO `aiml` VALUES(385013, "<category>\r\n<pattern>YES</pattern>\r\n<that>DO YOU FEEL THAT YOU ARE EXPERIENCING THOSE SIGNS</that>\r\n<template>You must be monitored by a qualified sports doctor.\r\n	  <br/>I do not have much expertise in this field.Am sorry!!\r\n</template>\r\n</category>", "YES", "DO YOU FEEL THAT YOU ARE EXPERIENCING THOSE SIGNS", "You must be monitored by a qualified sports doctor.\r\n	  <br/>I do not have much expertise in this field.Am sorry!!", "", "")
